@Override
public boolean equals(Object obj)
{
	if(this == obj)
		return true;
	if((obj == null) || (obj.getClass() != this.getClass()))
			return false;
	TermsFilter test = (TermsFilter)obj;
	return (terms == test.terms ||
				 (terms != null && terms.equals(test.terms)));
}

